# 1945 Fort Warren Broncos football team

The 1945 Fort Warren Broncos football team, sometimes referred to as the Broncs, Bronchos, or Cowboys, represented the United States Army base at Fort Warren, located in Cheyenne, Wyoming, during the 1945 college football season. Led by third-year head coach Wee Willie Smith, the Broncos compiled a record of 5â€“7. The team's roster included Roman Bentz, Mitchell Olenski, and Mac Speedie.
The Fort Warren Broncos were ranked 56th among the nation's college and service teams in the final Litkenhous Ratings.
